import React from 'react';
import { Link } from 'react-router-dom';
import './Carousel.css';

import animonda from '../assets/frontend_assets/animonda.png';
import bioline from '../assets/frontend_assets/bioline.png';
import classic_pets from '../assets/frontend_assets/classic_pets.png';
import petkin from '../assets/frontend_assets/petkin.png';
import meo from '../assets/frontend_assets/meO.png';
import arm_hammer from '../assets/frontend_assets/arm&hammer.png';
import equilibrio from '../assets/frontend_assets/equilibrio1.png';
import spot from '../assets/frontend_assets/spot.png';

const brands = [
    { name: 'animonda', image: animonda },
    { name: 'bioline', image: bioline },
    { name: 'classic_pets', image: classic_pets },
    { name: 'petkin', image: petkin },
    { name: 'meo', image: meo },
    { name: 'arm_hammer', image: arm_hammer },
    { name: 'equilibrio', image: equilibrio },
    { name: 'spot', image: spot }
];

const Carousel = () => {
    return (
        <div className='carousel'>
            <div className="logos">
                {brands.map((brand, index) => (
                    <Link key={index} to={`/brand/${brand.name}`}>
                        <img src={brand.image} alt={brand.name} />
                    </Link>
                ))}
            </div>
        </div>
    );
};

export default Carousel;
